import React from "react";
import ButtonMain from "../../components/ButtonMain/ButtonMain";
import * as colorClasses from "../../utils/colorClasses";

export default function Main() {
  let letterButtons = [];
  let buttonClasses = [
    colorClasses.buttonYellow,
    colorClasses.buttonRed,
    colorClasses.buttonPurple,
    colorClasses.buttonBlue,
    colorClasses.buttonGreen,
    colorClasses.buttonCyan,
    colorClasses.buttonChartreuse,
    colorClasses.buttonMagenta,
    colorClasses.buttonOrange,
  ];
  let i = 0;
  for (let letter of "ABCDEFGHIJKLMNOPQRSTUVWXYZ") {
    letterButtons.push(
      <>
        <ButtonMain buttonClass={buttonClasses[i++ % buttonClasses.length]}>
          Letter {letter}
        </ButtonMain>
      </>
    );
  }
  return <>grid grid-cols-4 gap-4{letterButtons}</>;
}
